var title_f14_44_15040="Scaphoid shift test 2";
var content_f14_44_15040=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F80834&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F80834&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 500px\">",
"   <div class=\"ttl\">",
"    Scaphoid shift test: Step 2",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 480px; height: 445px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Next, place your other thumb on the volar side of the scaphoid tubercle. The tubercle is located proximal to the thenar eminence near the wrist crease. Use the hand grasping the metacarpals to repeatedly move the wrist, alternating between ulnar and radial deviation, while lightly palpating with the opposite thumb for the tubercle of the scaphoid. Try to feel if the tubercle protrudes volarly during radial deviation and recedes with ulnar deviation. This preliminary movement helps position you to perform the actual test.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kevin deWeber, MD, FAAFP, FACSM.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
