var outline_f14_44_15041=null;
var title_f14_44_15042="Drug interactions with immunosuppressants";
var content_f14_44_15042=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F81998&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F81998&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major drug interactions with immunosuppressants: Cyclosporine, tacrolimus, sirolimus, or everolimus",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"20%\">",
"     </colgroup>",
"     <colgroup width=\"40%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td colspan=\"4\">",
"        Immunosuppressants are subject to numerous drug interactions, particularly with drugs or foods that inhibit or induce CYP 450 3A4 and/or P-gp. Drug therapy should be managed by transplant specialists with expertise in therapeutic drug monitoring, and doses should be adjusted based upon measurement of immunosuppressant concentrations, particularly whenever drug therapy is altered. The following is NOT a complete list of all possible interactions.*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <p>",
"         <strong>",
"          &uarr; INCREASED immunosuppressant concentration:",
"         </strong>",
"         Clinical effects may include infection, renal failure, cardiotoxicity, or other serious or life-threatening toxicity.",
"        </p>",
"        <p>",
"         <strong>",
"          &darr; DECREASED immunosuppressant concentration:",
"         </strong>",
"         Clinical effects may include risk of transplant organ rejection.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Interacting class",
"       </td>",
"       <td class=\"subtitle1\">",
"        Interacting agents",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect(s)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Management suggestions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Anticonvulsants",
"        </strong>",
"        (also see benzodiazepines below)",
"       </td>",
"       <td>",
"        Carbamazepine, fosphenytoin, oxcarbazepine, pentobarbital, phenobarbital, phenytoin, primidone",
"       </td>",
"       <td>",
"        &darr;&darr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Closely monitor immunosuppressant serum concentrations. Significant immunosuppressant dose increases may be needed. Avoid concomitant treatment with everolimus if possible. Effect of CYP3A4 induction may occur over weeks.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist_other_start\" colspan=\"4\">",
"        <strong>",
"         Antidiabetic",
"        </strong>",
"        (see hypoglycemic below)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist_other_start\" colspan=\"4\">",
"        <strong>",
"         Antimicrobials",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Aminoglycosides",
"       </td>",
"       <td>",
"        Amikacin, gentamicin, kanamycin, neomycin, streptomycin, tobramycin",
"       </td>",
"       <td>",
"        Elevated risk of nephrotoxicity with cyclosporine or tacrolimus",
"       </td>",
"       <td>",
"        Consider substituting a non-interacting antibiotic. If aminoglycosides are used with calcineurin inhibitors, closely monitor renal function and serum concentrations of aminoglycoside and calcineurin inhibitor.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Antifungals",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Clotrimazole (oral)",
"        <sup>",
"         &yen;",
"        </sup>",
"        , fluconazole",
"        <sup>",
"         &yen;",
"        </sup>",
"        , itraconazole, ketoconazole (oral), posaconazole, voriconazole",
"       </td>",
"       <td>",
"        <p>",
"         &uarr;&uarr; immunosuppressant concentration",
"        </p>",
"        <p>",
"         Additive QTc prolongation due to fluconazole or voriconazole with tacrolimus",
"        </p>",
"       </td>",
"       <td rowspan=\"2\">",
"        <p>",
"         Closely monitor immunosuppressant concentrations to determine necessary dose adjustment. Everolimus prescribing information (US) recommends avoiding concurrent use with strong CYP3A4 inhibitors (such as itraconazole, ketoconazole, posaconazole and voriconazole).",
"        </p>",
"        <p>",
"         The following empiric initial dose adjustments may be considered: decrease tacrolimus dose by 66 percent if initiating posaconazole or voriconazole, or by 40 percent if initiating fluconazole &ge;200 mg/day; or decrease cyclosporine dose by 50 percent if initiating voriconazole or 25 percent if initiating posaconazole or fluconazole &ge;200 mg/day; or decrease sirolimus dose by 50 to 90 percent if initiating any azole antifungal.",
"         <sup>",
"          &Delta;[1]",
"         </sup>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Amphotericin",
"       </td>",
"       <td>",
"        Increased risk of nephrotoxicity with cyclosporine or tacrolimus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antimalarials",
"       </td>",
"       <td>",
"        Halofantrine",
"        <sup>",
"         &bull;",
"        </sup>",
"        , lumefantrine, mefloquine, quinine, quinidine",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; immunosuppressant concentration with mefloquine, quinine or quinidine",
"        </p>",
"        <p>",
"         Additive QTc prolongation due to tacrolimus with anti-malarials",
"        </p>",
"       </td>",
"       <td>",
"        Monitor immunosuppressant concentrations to determine dose alteration if concurrent treatment with mefloquine, quinine, or quinidine is necessary. Monitor for QTc prolongation if antimalarial treatment must be initiated in a patient receiving tacrolimus. Avoid lumefantrine with tacrolimus.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antimycobacterial",
"       </td>",
"       <td>",
"        Rifabutin, rifampin, rifapentine",
"       </td>",
"       <td>",
"        &darr;&darr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Closely monitor immunosuppressant serum concentrations and allograft function. Significant immunosuppressant dose increases may be needed, particularly with rifampin.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        HIV and hepatitis C virus (HCV) antiretrovirals",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Amprenavir",
"        <sup>",
"         &bull;",
"        </sup>",
"        , atazanavir, boceprevir, cobicistat containing co-formulations, darunavir, delavirdine, fosamprenavir",
"        <sup>",
"         ������",
"        </sup>",
"        , indinavir, lopinavir-ritonavir, nelfinavir, ritonavir, saquinavir, telaprevir, tipranavir",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         &uarr;&uarr; immunosuppressant concentration",
"        </p>",
"        <p>",
"         Cyclosporine may increase protease inhibitor concentrations",
"        </p>",
"       </td>",
"       <td>",
"        Closely monitor immunosuppressant serum concentrations and for signs of toxicity (eg, nephrotoxicity). Significant immunosuppressant dose reductions may be needed. Avoid concomitant treatment with everolimus if possible. If used with cyclosporine, monitor protease inhibitor(s) for toxicity and serum concentrations where available. Early consultation with HIV/HCV infectious diseases specialist is recommended.",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Efavirenz",
"        <sup>",
"         ������",
"        </sup>",
"        , etravirine, nevirapine, tipranavir",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"       <td>",
"        &darr;&darr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Closely monitor immunosuppressant serum concentrations and allograft function.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Macrolide antibiotics",
"       </td>",
"       <td>",
"        Clarithromycin, erythromycin, telithromycin (ketolide)",
"       </td>",
"       <td>",
"        &uarr;&uarr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Consider substituting a non-interacting antibiotic. Azithromycin and spiramycin",
"        <sup>",
"         &bull;",
"        </sup>",
"        are less likely to interact.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Other anti-infectives",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        Chloramphenicol, levofloxacin (with tacrolimus or cyclosporine), metronidazole, norfloxacin (with cyclosporine), quinupristin-dalfoprisitin, tetracycline, tigecycline",
"       </td>",
"       <td>",
"        &uarr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Monitor immunosuppressant concentrations during concurrent therapy to determine whether dose alteration is needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nafcillin",
"       </td>",
"       <td>",
"        &darr;&darr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Consider substituting a non-interacting antibiotic such as oxacillin or flucloxacillin. If concurrent therapy is required, monitor immunosuppressant to determine whether dose alteration is needed.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        <strong>",
"         Antineoplastic",
"        </strong>",
"       </td>",
"       <td>",
"        Bicalutamide",
"        <sup>",
"         &yen;",
"        </sup>",
"        , nilotinib, sunitinib, tamoxifen, vandetanib, vemurafenib",
"       </td>",
"       <td>",
"        &uarr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Monitor immunosuppressant concentrations during concurrent therapy to determine whether dose alteration is needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antineoplastic agents that are dependent upon&nbsp;CYP3A4 and/or P-gp (eg, doxorubicin, vinblastine)",
"       </td>",
"       <td>",
"        Cyclosporine, and to a lesser degree tacrolimus, may increase concentrations and toxicity of antineoplastic agents that are major substrates of CYP3A4 and/or P-gp. Immunosuppressant concentrations may be altered by doxorubicin",
"        <sup>",
"         ������",
"        </sup>",
"        or vinblastine",
"        <sup>",
"         ������",
"        </sup>",
"        .",
"       </td>",
"       <td>",
"        Monitor antineoplastic for exaggerated toxicity. Monitor immunosuppressant concentrations during concurrent therapy to determine whether dose alteration is needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Crizotinib",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; cyclosporine and tacrolimus",
"        </p>",
"        <p>",
"         Increased QT prolongation with tacrolimus",
"        </p>",
"       </td>",
"       <td>",
"        Monitor immunosuppressant concentrations during concurrent therapy to determine whether dose alteration is needed. Avoid crizotinib with tacrolimus or monitor for QTc prolongation.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Benzodiazepines",
"        </strong>",
"        (also see hypnotics below)",
"       </td>",
"       <td>",
"        Alprazolam, clonazepam, clorazepate, diazepam, flurazepam, midazolam, triazolam",
"       </td>",
"       <td>",
"        Moderate increase in benzodiazepine concentration with cyclosporine",
"       </td>",
"       <td>",
"        Monitor benzodiazepine effect to determine whether dose alteration needed.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist_other_start\" colspan=\"4\">",
"        <strong>",
"         Cardiovascular",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Angiotensin converting enzyme (ACE) inhibitors",
"       </td>",
"       <td>",
"        Benazepril, captopril, cilazapril, enalapril, enalaprilat, fosinopril, lisinopril, moexipril, perindopril, quinapril, ramipril, trandolapril",
"       </td>",
"       <td>",
"        Increased risk of angioedema with sirolimus or everolimus; case reports of nephrotoxicity with cyclosporine",
"       </td>",
"       <td>",
"        Monitor for toxicity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antiarrhythmics",
"       </td>",
"       <td>",
"        Amiodarone, dronedarone, lidocaine",
"        <sup>",
"         &yen;",
"        </sup>",
"        (systemic), quinidine",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; immunosuppressant concentration",
"        </p>",
"        <p>",
"         Additive QTc prolongation with tacrolimus",
"        </p>",
"       </td>",
"       <td>",
"        Monitor immunosuppressant serum concentrations and signs of toxicity (eg, nephrotoxicity and cardiotoxicity). Significant immunosuppressant dose reductions may be needed. According to US prescribing information, use of dronedarone with cyclosporine or tacrolimus is contraindicated. Avoid QTc prolonging antiarrhythmics with tacrolimus or closely monitor for QTc prolongation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Anticoagulants, newer oral",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"       <td>",
"        Apixaban, dabigatran, rivaroxaban",
"       </td>",
"       <td>",
"        Increased newer oral anticoagulant effect with cyclosporine or tacrolimus",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         If concomitant use is required, administer apixaban, dabigatran, or rivaroxaban two hours before cyclosporine or tacrolimus to minimize effect. Monitor for signs of excessive anticoagulation. Avoid newer oral anticoagulants in patients receiving cyclosporine or tacrolimus with renal insufficiency (CrCl &lt;50 mL/minute).",
"         <sup>",
"          &sect;",
"         </sup>",
"        </p>",
"        <p>",
"         Significant alteration of warfarin's anticoagulant effect has not been associated with these immunosuppressants.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Calcium channel blockers (CCB)",
"       </td>",
"       <td>",
"        Diltiazem, nicardipine, verapamil",
"       </td>",
"       <td>",
"        &uarr;&uarr; immunosuppressant concentrations",
"       </td>",
"       <td>",
"        Monitor immunosuppressant serum concentrations and signs of toxicity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Amlodipine, felodipine, nifedipine, nimodipine, nisoldipine",
"       </td>",
"       <td>",
"        Increased dihydropyridine CCB concentration with cyclosporine",
"       </td>",
"       <td>",
"        Monitor for exaggerated dihydropyridine CCB effects including hypotension and bradycardia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        HMG-CoA reductase inhibitors(\"statins\") (also see ezetimibe below)",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"       <td>",
"        Atorvastatin, lovastatin, pitavastatin, pravastatin, rosuvastatin, simvastatin",
"       </td>",
"       <td>",
"        Increased statin concentrations and risk of statin toxicity including myotoxicity with cyclosporine",
"       </td>",
"       <td>",
"        Fluvastatin or pravastatin appears to have a lower risk of interaction with cyclosporine and may be preferred. Avoid simvastatin and pitavastatin (contraindicated in US prescribing information with cyclosporine). Limit lovastatin to 20 mg per day, atorvastatin to 10 mg per day, or rosuvastatin to 5 mg per day with cyclosporine. Monitor for signs of myotoxicity.",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Atorvastatin",
"       </td>",
"       <td>",
"        &uarr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Potential interaction specific to atorvastatin due to its inhibition of P-gp.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Potassium-sparing diuretics",
"       </td>",
"       <td>",
"        Amiloride, triamterene, spironolactone",
"       </td>",
"       <td>",
"        Increased risk of hyperkalemia with cyclosporine and to a lesser degree tacrolimus; effect more pronounced with renal insufficiency",
"       </td>",
"       <td>",
"        In general, potassium sparing diuretics are avoided with cyclosporine.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Other cardiovascular",
"       </td>",
"       <td>",
"        Carvedilol, dipyridamole, propranolol, ranolazine, reserpine",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; immunosuppressant concentration",
"        </p>",
"        <p>",
"         Additive QTc prolongation if ranolazine used with tacrolimus",
"        </p>",
"       </td>",
"       <td>",
"        Concentrations of tacrolimus and sirolimus are less likely to be altered due to these interactions than everolimus or cyclosporine. Monitor immunosuppressant concentrations during concurrent therapy to determine whether dose alteration is needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ezetimibe",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"       <td>",
"        &uarr; ezetimibe concentration",
"       </td>",
"       <td>",
"        Increased concentrations of ezetimibe and possible alteration of cyclosporine level. 5 mg ezetimibe daily may suffice for LDL lowering effect in combination with cyclosporine.",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Dietary",
"        </strong>",
"       </td>",
"       <td>",
"        Grapefruit juice",
"       </td>",
"       <td>",
"        &uarr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Avoid grapefruit juice and grapefruit with immunosuppressants.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"5\">",
"        <strong>",
"         Gastrointestinal",
"        </strong>",
"       </td>",
"       <td>",
"        Aprepitant",
"        <sup>",
"         &yen;",
"        </sup>",
"        , cimetidine",
"        <sup>",
"         &yen;",
"        </sup>",
"        , fosaprepitant",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"       <td>",
"        &uarr; immunosuppressant concentration",
"       </td>",
"       <td rowspan=\"2\">",
"        Monitor immunosuppressant concentrations during concurrent therapy to determine whether dose alteration is needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Metoclopramide",
"       </td>",
"       <td>",
"        &uarr; immunosuppressant concentration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Octreotide",
"       </td>",
"       <td>",
"        <p>",
"         &darr; cyclosporine (orally administered)",
"        </p>",
"        <p>",
"         Additive QTc prolongation with tacrolimus",
"        </p>",
"       </td>",
"       <td>",
"        Cyclosporine microemulsion may be less likely to interact with octreotide.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Orlistat",
"       </td>",
"       <td>",
"        &darr;&darr; cyclosporine",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Omeprazole, lansoprazole",
"       </td>",
"       <td>",
"        &uarr; tacrolimus",
"       </td>",
"       <td>",
"        Pantoprazole and rabeprazole are less likely to interact with tacrolimus.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist_other_start\" colspan=\"4\">",
"        <strong>",
"         Glucocorticoids and anti-gout",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Glucocorticoids, systemic (also see immunosuppressants below)",
"       </td>",
"       <td>",
"        Methylprednisolone, dexamethasone, prednisone, prednisolone",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; or &darr; cyclosporine",
"        </p>",
"        <p>",
"         &darr; everolimus",
"        </p>",
"        <p>",
"         &uarr; methylprednisolone, prednisone, or prednisolone concentration",
"        </p>",
"       </td>",
"       <td>",
"        Variable effects are described. If possible, avoid dexamethasone with everolimus. Monitor immunosuppressant concentrations closely.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Anti-gout",
"       </td>",
"       <td>",
"        Allopurinol",
"       </td>",
"       <td>",
"        &uarr;&uarr; cyclosporine",
"       </td>",
"       <td>",
"        Closely monitor cyclosporine concentration to determine need for dose alteration.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Colchicine",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; colchicine toxicity with cyclosporine or tacrolimus. Toxic effects more pronounced with renal and/or hepatic insufficiency.",
"        </p>",
"        <p>",
"         &uarr; cyclosporine",
"        </p>",
"       </td>",
"       <td>",
"        Monitor colchicine toxicity and consider colchicine dose reduction with cyclosporine or tacrolimus if co-administration is unavoidable. For patients with normal renal and hepatic function, the following colchicine dose reductions are suggested: Acute gout: 0.6 mg once followed by 0.3 mg one hour later. Do not repeat before 72 hours. Gout prophylaxis: reduce dose by 50 percent; double interval. Familial Mediterranean fever: maximum daily dose 0.6 mg. Avoid colchicine with cyclosporine or tacrolimus in patients with renal and/or hepatic insufficiency.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <strong>",
"         Herbs",
"        </strong>",
"       </td>",
"       <td>",
"        St. Johns wort",
"       </td>",
"       <td>",
"        &darr;&darr; immunosuppressant concentration",
"       </td>",
"       <td>",
"        Avoid St. Johns wort with immunosuppressants.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Schisandra",
"       </td>",
"       <td>",
"        &uarr; tacrolimus",
"       </td>",
"       <td>",
"        Avoid Schisandra with immunosuppressants.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <strong>",
"         Hormones",
"        </strong>",
"       </td>",
"       <td>",
"        Estrogen preparations",
"       </td>",
"       <td>",
"        &uarr; cyclosporine",
"       </td>",
"       <td>",
"        Estrogenic hormones may increase cyclosporine concentrations and risk of toxicities including renal, hepatic, and central nervous system (seizures). Monitor cyclosporine concentrations and effects closely when estrogens are started or discontinued.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Testosterone preparations (including danazol, methyltestosterone, testosterone)",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; cyclosporine",
"        </p>",
"        <p>",
"         &uarr; tacrolimus",
"        </p>",
"       </td>",
"       <td>",
"        Androgenic hormones may increase cyclosporine concentrations and risk toxicity. Avoid use with cyclosporine if possible. Similar effect is associated with tacrolimus in a case report.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Hypnotic",
"        </strong>",
"        (also see benzodiazepines above)",
"       </td>",
"       <td>",
"        Eszopiclone, zolpidem",
"       </td>",
"       <td>",
"        Moderate increase in hypnotic concentration with cyclosporine",
"       </td>",
"       <td>",
"        Monitor hypnotic effect to determine whether dose alteration is needed.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <strong>",
"         Hypoglycemic",
"        </strong>",
"       </td>",
"       <td>",
"        Insulins, nateglinide, repaglinide, saxagliptin, sitagliptin",
"       </td>",
"       <td>",
"        If used with cyclosporine",
"        <sup>",
"         &yen;",
"        </sup>",
"        or tacrolimus, potential loss of glycemic control or worsening of hyperglycemia",
"       </td>",
"       <td>",
"        Monitor glycemic control with calcineurin inhibitors.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sulfonylureas including gliclazide, glimepiride, glipizide, glyburide",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; cyclosporine",
"        </p>",
"        <p>",
"         &darr; sulfonylurea effect with cyclosporine",
"        </p>",
"       </td>",
"       <td>",
"        Monitor cyclosporine concentrations closely. Monitor glycemic control with cyclosporine.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"sublist_other_start\" colspan=\"4\">",
"        <strong>",
"         Immunosuppressant",
"        </strong>",
"        (also see glucocorticoids above)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"       <td>",
"        Cyclosporine",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Increased risk of serious renal, hematologic, and other toxicities in combination with tacrolimus",
"         </strong>",
"         and to lesser degree sirolimus",
"        </p>",
"        <p>",
"         &darr;&darr; mycophenolate",
"        </p>",
"        <p>",
"         &uarr;&uarr; everolimus",
"        </p>",
"        <p>",
"         &uarr;&uarr; sirolimus (with cyclosporine microemulsion)",
"        </p>",
"       </td>",
"       <td>",
"        Tacrolimus and cyclosporine should",
"        <strong>",
"         not",
"        </strong>",
"        be co-administered. Alteration of mycophenolate dosing is usually required when cyclosporine is initiated, stopped, or added. When used with everolimus, reduction of cyclosporine dose and target concentration is generally necessary. Risk of serious hematologic abnormalities is increased when cyclosporine is used with sirolimus. It is suggested that oral doses of sirolimus be administered four hours after cyclosporine doses.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tacrolimus",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Increased risk of serious renal, hematologic, or other toxicities with sirolimus or cyclosporine",
"         </strong>",
"         (see above)",
"        </p>",
"        <p>",
"         &uarr; everolimus",
"        </p>",
"       </td>",
"       <td>",
"        Avoid concomitant use of tacrolimus and sirolimus; serious toxicities have been reported. Tacrolimus and cyclosporine should",
"        <strong>",
"         not",
"        </strong>",
"        be co-administered; see information above. If everolimus is used with tacrolimus, closely monitor immunosuppressant concentrations to determine whether dose alteration is required.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Nonsteroidal antiinflammatory drugs (NSAIDs)",
"        </strong>",
"       </td>",
"       <td>",
"        Examples include celecoxib, ibuprofen, naproxen, others",
"       </td>",
"       <td>",
"        If used with cyclosporine or tacrolimus, increased risk of nephrotoxicity and hypertension",
"       </td>",
"       <td>",
"        In general, avoid NSAIDs with cyclosporine or tacrolimus. If concomitant use is required, monitor renal function and blood pressure.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <strong>",
"         Psychiatry",
"        </strong>",
"       </td>",
"       <td>",
"        Desipramine",
"        <sup>",
"         &yen;",
"        </sup>",
"        , haloperidol",
"        <sup>",
"         &yen;",
"        </sup>",
"        , fluoxetine",
"        <sup>",
"         &yen;",
"        </sup>",
"        , fluvoxamine",
"        <sup>",
"         &yen;",
"        </sup>",
"        , sertraline",
"        <sup>",
"         &yen;",
"        </sup>",
"        , nefazodone",
"        <sup>",
"         ������",
"        </sup>",
"        , trazodone",
"        <sup>",
"         &yen;",
"        </sup>",
"        ; (also see \"herb\", \"benzodiazepines\")",
"       </td>",
"       <td>",
"        <p>",
"         &uarr; immunosuppressant concentration",
"        </p>",
"        <p>",
"         (exception: variable effect of nefazodone including increased and decreased immunosuppressant concentration)",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Avoid use of nefazodone with immunosuppressants",
"         <sup>",
"          ������",
"         </sup>",
"         . Nefazodone has been rarely associated with hepatoxicity and liver failure in non-transplant population.",
"        </p>",
"        <p>",
"         Monitor immunosuppressant if used with other interacting agents.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pimozide",
"       </td>",
"       <td>",
"        Elevated pimozide level and/or increased QTc prolongation with cyclosporine, tacrolimus, or sirolimus",
"       </td>",
"       <td>",
"        Avoid use of pimozide with cyclosporine, sirolimus, or tacrolimus due to increased risk of cardiotoxicity.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        <strong>",
"         Other",
"        </strong>",
"       </td>",
"       <td>",
"        Bosentan",
"       </td>",
"       <td>",
"        &darr;&darr; immunosuppressant concentration",
"       </td>",
"       <td rowspan=\"4\">",
"        Monitor immunosuppressant concentrations during concurrent therapy to determine whether dose alteration is needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cinacalcet",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"       <td>",
"        &darr; tacrolimus or cyclosporine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Conivaptan",
"       </td>",
"       <td>",
"        &uarr; immunosuppressant concentration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sevelamer",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         &darr; tacrolimus",
"        </p>",
"        <p>",
"         &darr;&darr; cyclosporine",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Interaction data and recommendations refer to systemic drug forms of cyclosporine, tacrolimus, sirolimus, or everolimus as immunosuppressant agents.",
"    <div class=\"footnotes\">",
"     CYP3A4: cytochrome P450 3A4; P-gp: P-glycoprotein efflux membrane transporters; HCV: hepatitis C virus; NSAID: nonsteroidal antiinflammatory drug; CCB: calcium channel blocker; ACEI: angiotensin converting enzyme inhibitor.",
"     <br>",
"      * For additional information see Lexi-Interact&trade; drug interactions&nbsp;program included with UpToDate. Also refer to UpToDate topic review&nbsp;of pharmacology and side effects of cyclosporine and tacrolimus (sections on drug interactions).",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       Not available in US.",
"       <br>",
"        &Delta; For additional information, refer to the UpToDate topic review on pharmacology of azole antifungal agents (section on selected clinical effects).",
"        <br>",
"         <font class=\"lozenge\">",
"          &loz;",
"         </font>",
"         For additional information, refer to the UpToDate topic review on solid organ transplantation in HIV-infected individuals (section on pharmacological aspects after transplantation).",
"         <br>",
"          &sect; For additional information, refer to the UpToDate review on anticoagulants other than heparin and warfarin (sections on novel oral anticoagulant interactions).",
"          <br>",
"           &yen; Moderate metabolic inhibitor(s). Interaction effect may be moderate.",
"           <br>",
"            &Dagger; Complex effects may increase or decrease serum concentration of immunosuppressants highly dependent upon CYP3A4 and/or P-gp for elimination.",
"            <br>",
"             &dagger; For additional information refer to the UpToDate topic review on nonimmunologic complications of liver transplantation (section on hyperlipidemias).",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     <br>",
"      Lexi-Interact. Copyright &copy; 1978-2013 Lexicomp, Inc. All Rights Reserved.",
"      <br>",
"       Additional data:",
"       <br>",
"        <ol>",
"         <li>",
"          Dodds-Ahsley E. Management of drug and food interactions with azole antifungals in transplant recipients; Pharmacotherapy 2010; 30(8):842.",
"         </li>",
"         <li>",
"          Kuypers D, Immunotherapy in elderly transplant recipients: A guide to clinically significant drug interactions. Drugs Aging 2009; 26(9):715.",
"         </li>",
"        </ol>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
