var script_f14_44_15044=[""].join("\n");
var outline_f14_44_15044=null;
var title_f14_44_15045="DIEP flap breast reconstruction";
var content_f14_44_15045=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F66615&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F66615&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 542px\">",
"   <div class=\"ttl\">",
"    DIEP flap breast reconstruction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 522px; height: 686px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The most commonly used perforator flap for breast reconstruction is the deep inferior epigastric perforator (DIEP) flap. The DIEP uses the lower abdominal island of skin and fat and spares the rectus abdominis muscle. Although the underlying muscle must be split to dissect out the perforating vessels, the muscle itself is not included in the transfer. The deep inferior epigastric artery and vein, which provide the vascular supply for the free flap, are anastomosed to local recipient vessels, using either the internal mammary or thoracodorsal arteries and veins.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
