var title_f14_44_15050="Progression of human coronary atherosclerosis I";
var content_f14_44_15050=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F71847&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F71847&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 597px\">",
"   <div class=\"ttl\">",
"    Progression of human coronary atherosclerosis I",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 577px; height: 619px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Histopathology of human coronary plaque progression, part 1 of 2.",
"    <br>",
"     (A) Intimal thickening is normal in all age groups and is characterized by smooth muscle cell accumulation within the intima.",
"     <br>",
"      (B) Intimal xanthoma or so-called fatty streak corresponds to the accumulation of predominantly macrophages within the intima; these lesions have been shown to regress in later adult life.",
"      <br>",
"       (C) Pathologic intimal thickening marks the first of the progressive lesions and denotes the accumulation of extracellular lipid in the absence of apparent necrosis.",
"       <br>",
"        (D) Fibrous cap atheroma indicates the presence of an encapsulated necrotic core.",
"        <br>",
"         (E) The core may eventually become thinned (thin-cap fibroatheroma).",
"         <br>",
"          (F) This lesion may rupture, allowing contact of the contents of the necrotic core, causing a luminal thrombosis.",
"          <div class=\"footnotes\">",
"           EL: extracellular lipid; NC: necrotic core; FC: fibrous cap; Th: thrombus.",
"          </div>",
"          <div class=\"reference\">",
"           Reproduced with permission from: Virmani R, Kolodgie FD, Burke AP. Lessons from sudden coronary death: a comprehensive morphological classification scheme for atherosclerotic lesions. Arterioscler Thromb Vasc Biol 2000; 20:1262. Copyright &copy; 2000 Lippincott Williams &amp; Wilkins.",
"          </div>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
