var title_f14_44_15051="Differential dx fibromyalgia";
var content_f14_44_15051=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F50712&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F50712&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of fibromyalgia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Helpful features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rheumatoid arthritis or lupus",
"       </td>",
"       <td>",
"        Symmetrical polyarthritis, systemic features (dermatitis,",
"nephritis), elevated erythrocyte sedimentation rate, serologic",
"abnormalities (rheumatoid factor, anti-DNA antibodies)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Polymyalgia rheumatica",
"       </td>",
"       <td>",
"        Elderly, elevated erythrocyte sedimentation rate, stiffness&gt;pain, responds well and quickly to steroids",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myositis",
"       </td>",
"       <td>",
"        Muscle weakness, elevated muscle enzymes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypothyroidism",
"       </td>",
"       <td>",
"        Abnormal thyroid function tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperparathyroidism",
"       </td>",
"       <td>",
"        Hypercalcemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neuropathies",
"       </td>",
"       <td>",
"        Clinical and electrical evidence of neuropathy",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
