var title_f14_44_15052="Ingredient label terms for soy";
var content_f14_44_15052=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F77407&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F77407&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    How to read an ingredient label for a soy-free diet",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Avoid foods that contain soy or any of these ingredients:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Edamame",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Miso",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Natto",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Shoyu",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soy (soy albumin, soy cheese, soy fiber, soy flour, soy grits, soy ice cream, soy milk, soy nuts, soy sprouts, soy yogurt)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soya",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soybean (curd, granules)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soy protein (concentrate, hydrolyzed, isolate)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soy sauce",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tamari",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tempeh",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Textured vegetable protein (TVP)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tofu",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Soy is sometimes found in the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Asian cuisine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vegetable broth",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vegetable gum",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vegetable starch",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Keep the following in mind:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;",
"        <strong>",
"         The FDA exempts highly refined soybean oil from being labeled as an allergen.",
"        </strong>",
"        Studies show most allergic individuals can safely eat soy oil that has been highly refined (",
"        <em>",
"         not",
"        </em>",
"        cold pressed, expeller pressed, or extruded soybean oil).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Most individuals allergic to soy can safely eat soy lecithin.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Follow your doctor's advice regarding these ingredients.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    All FDA-regulated manufactured food products that contain soy as an ingredient are required by US law to list the word \"soy\" on the product label.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; 2010 The Food Allergy &amp; Anaphylaxis Network. Used with permission.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
